import React, { Component } from 'react'
import cardImg from '../images/maincard.png';
import Navbar from './Navbar';
export default class MainCard extends Component {
    render() {
        return (
            <div>
            <div
          class="card pmd-card bg-dark text-white text-center overlay-card"
          style={{ height: "82.5vh" }}
        >
          <img
            src={cardImg}
            alt="About"
            class="pmd-card-media"
            style={{ height: "82.5vh" }}
          />
          <div
            class="card-img-overlay"
            style={{
              border: "5px solid red",
              width: "50%",
              height: "50vh",
              margin: "auto 0",
              marginLeft: "100px",
            }}
          >
            <h2 class="card-title text-danger">About Us</h2>
            <p class="card-text text-dark">
              Lorem Ipsum is simply dummy text of the printing and typesetting
